"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Age-related hearing loss (presbycusis) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/age-related-hearing-loss-presbycusis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H24673197\">",
"      <span class=\"h1\">",
"       What is age-related hearing loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;When people talk about age-related hearing loss, they are usually referring to a condition called &ldquo;presbycusis.&rdquo; This condition becomes more common with age. It affects more than half of all adults by the time they reach the age of 75. &nbsp;",
"     </p>",
"     <p>",
"      Presbycusis causes you to slowly lose your hearing in both ears. It mostly affects how well you hear high pitched sounds. That means that a person with presbycusis might have trouble hearing a bird chirping or a phone ringing but still be able to hear a truck rumbling. Also, people with presbycusis often find that they have a hard time hearing in crowded places.",
"     </p>",
"     <p>",
"      Presbycusis is just one form of hearing loss that happens as you age. There are other conditions that affect hearing that also become more common with age. The most common of these is a condition called tinnitus, which causes you to hear ringing, buzzing, hissing, or roaring in one or both ears. Often presbycusis and tinnitus occur together.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673212\">",
"      <span class=\"h1\">",
"       What causes hearing loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;When doctors refer to hearing loss, they often talk about:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Sensorineural hearing loss",
"        </strong>",
"        &ndash; This type of hearing loss happens when structures in the ear that register sounds and send signals to the brain are damaged. These structures are found deep in the ear in a part called the &ldquo;inner ear&rdquo; (",
"        <a class=\"graphic graphic_figure graphicRef55121 \" href=\"mobipreview.htm?29/61/30677\">",
"         figure 1",
"        </a>",
"        ). Presbycusis is a type of sensorineural hearing loss.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Conductive hearing loss",
"        </strong>",
"        &ndash; This type of hearing loss happens when sounds can&rsquo;t get to the inner ear because of problems in the middle or outer ear. For example, conductive hearing loss can happen if you have too much wax in your ear, and sounds are being muffled. It can also happen if you have an ear infection and parts of your ear are swollen or filled with fluid.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Mixed hearing loss",
"        </strong>",
"        &ndash; Mixed hearing loss happens when both types of hearing loss mentioned above occur at the same time. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673228\">",
"      <span class=\"h1\">",
"       What other symptoms should I watch for?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you develop sudden hearing loss, look for important signs, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Dizziness",
"       </li>",
"       <li>",
"        Fluid coming from your ears",
"       </li>",
"       <li>",
"        Feeling as though your ears are &ldquo;full&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673243\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if you have any of the above symptoms or if your hearing loss does not go away or gets worse.",
"     </p>",
"     <p>",
"      Your doctor or nurse will ask about your hearing loss and about the medicines you take now and have taken. That&rsquo;s because some medicines can cause hearing problems. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673258\">",
"      <span class=\"h1\">",
"       Are there tests I should have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will probably start by looking inside your ear using a special tool called an &ldquo;otoscope.&rdquo; That way, he or she can check if anything looks swollen, blocked, torn or infected. Then your doctor or nurse will decide which tests you should have based on your age, your medical history, other symptoms, and your physical exam. If he or she suspects hearing loss, you will probably need a test called an &ldquo;audiogram.&rdquo;",
"     </p>",
"     <p>",
"      A hearing specialist, called an &ldquo;audiologist,&rdquo; will do the audiogram. To do the test, you put on a headset. Then the audiologist plays sounds in one ear at a time and asks you to indicate when you hear the sounds. This test will show how severe your hearing loss is and whether both ears are affected the same way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673273\">",
"      <span class=\"h1\">",
"       How is hearing loss treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have presbycusis, your ear doctor (called an &ldquo;otolaryngologist&rdquo;) will probably recommend hearing aids. But if you have other hearing problems, too, they might need different treatments. For instance, if you have too much wax in your ears, your doctor or nurse can teach you how to get the wax out. And if you have ringing or buzzing in your ears because of tinnitus, you might need to learn special skills to manage that problem.",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Hearing aids",
"        </strong>",
"        &ndash; You might not want to wear hearing aids because they make you feel embarrassed, or because you think they don&rsquo;t work. If your doctor recommends them, try to keep an open mind, even if you have tried them in the past. Hearing aid technology has gotten a lot better. There are now lots of different types of hearing aids to try. It might take a few tries to find the right type of aid and the right settings, but hearing aids can really help. The key is to work with your ear doctor until you find the best option for you. Always tell him or her if you have problems with the way your hearing aids sound or fit. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673288\">",
"      <span class=\"h1\">",
"       Can hearing loss be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some forms of hearing loss can be prevented. To protect your hearing, the most important thing you can do is avoid loud noises. If you must be around loud noises, then wear ear plugs or head phones that will protect your ears.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H24673303\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?42/26/43425?source=see_link\">",
