"   </div>",
"   <div class=\"lgnd\">",
"    Endoscopic view of the distended distal esophagus revealing complete healing of the superficial ulceration with a ring of thin membrane occluding 70 percent of the distal esophageal lumen. This is the characteristic endoscopic view of a Schatzki ring.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Andres Gelrud, MD and Douglas A. Horst, MD.",
"    </div>",
"   </div>",
