"    Schatzki ring dilation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 252px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Endoscopic imaging showing balloon dilation of the distal esophageal ring.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Andres Gelrud, MD and Douglas A. Horst, MD.",
"    </div>",
"   </div>",
"  </div>",
