var title_f32_26_33190="Pathogenesis of photoaging";
var content_f32_26_33190=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F78164&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F78164&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 618px\">",
"   <div class=\"ttl\">",
"    Pathogenesis of photoaging",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 598px; height: 412px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This diagram demonstrates the effects of UV irradiation on the skin. UV radiations activate growth factor and cytokine receptors, which induce transcription factor AP-1, resulting in the upregulation of matrix metalloproteinase (MMP) genes. AP-1 also disturbs procollagen gene expression. The end results are dermal matrix breakdown and decreased collagen synthesis. The cumulative effect of repeated UV injury determines the clinical features seen in photoaged skin.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Fisher GJ, Kang S, Varani J, et al. Mechanisms of photoaging and chronological skin aging. Arch Dermatol 2002; 138:1462. Copyright &copy; 2002 American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
