" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Symptom-based management of amyotrophic lateral sclerosis",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
