var title_f32_26_33195="Ethambutol weight-based dosing";
var content_f32_26_33195=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F51663&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=53\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F51663&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=53\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Weight-based* dosing recommendations for ethambutol",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        40 to 55 kg",
"       </td>",
"       <td class=\"subtitle1\">",
"        56 to 75 kg",
"       </td>",
"       <td class=\"subtitle1\">",
"        76 to 90 kg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Daily, mg (mg/kg)",
"       </td>",
"       <td>",
"        800",
"       </td>",
"       <td>",
"        1200",
"       </td>",
"       <td>",
"        1600",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (14.5 to 20.0)",
"       </td>",
"       <td>",
"        (16.0 to 21.4)",
"       </td>",
"       <td>",
"        (17.8 to 21.1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Thrice weekly, mg (mg/kg)",
"       </td>",
"       <td>",
"        1200",
"       </td>",
"       <td>",
"        2000",
"       </td>",
"       <td>",
"        2400",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (21.8 to 30.0)",
"       </td>",
"       <td>",
"        (26.7 to 35.7)",
"       </td>",
"       <td>",
"        (26.7 to 31.6)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Twice weekly, mg (mg/kg)",
"       </td>",
"       <td>",
"        2000",
"       </td>",
"       <td>",
"        2800",
"       </td>",
"       <td>",
"        4000",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (36.4 to 50.0)",
"       </td>",
"       <td>",
"        (37.3 to 50.0)",
"       </td>",
"       <td>",
"        (44.4 to 52.6)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Estimated lean body weight should be utilized.",
"     <br>",
"      &bull;&nbsp;Maximum doses regardless of weight.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
