var title_f32_26_33196="Characteristic features of congenital infections";
var content_f32_26_33196=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical manifestations that are suggestive of specific congenital infections in the neonate",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Congenital cytomegalovirus",
"       </td>",
"       <td>",
"        Periventricular intracranial calcifications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Microcephaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"5\">",
"        Congenital herpes simplex virus",
"       </td>",
"       <td>",
"        Mucocutaneous vesicles or scarring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CSF pleocytosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated liver transaminases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Conjunctivitis or keratoconjuctivitis",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Congenital rubella",
"       </td>",
"       <td>",
"        Cataracts, congenital glaucoma, pigmentary retinopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenital heart disease (most commonly patent ductus arteriosus or peripheral pulmonary artery stenosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radiolucent bone disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sensorineural hearing loss",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Congenital syphilis",
"       </td>",
"       <td>",
"        Skeletal abnormalities (osteochondritis and periostitis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pseudoparalysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Persistent rhinitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maculopapular rash (particularly on palms and soles or in diaper area)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Congenital toxoplasmosis",
"       </td>",
"       <td>",
"        Intracranial calcifications (diffuse)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hydrocephalus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chorioretinitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Otherwise unexplained mononuclear CSF pleocytosis or elevated CSF protein",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Congenital varicella",
"       </td>",
"       <td>",
"        Cicatricial or vesicular skin lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limb hypoplasia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CSF: cerebrospinal fluid.",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Maldonado YA, Nizet V, Klein JO, et al. Current concepts of infections of the fetus and newborn infant. In: Infectious Diseases of the Fetus and Newborn Infant, 7th ed, Remington JS, Klein JO, Wilson CB, et al (Eds), Saunders, Philadelphia 2011. p.2.",
"      </li>",
"      <li>",
"       Sanchez PJ, Demmler-Harrison GJ. Viral infections of the fetus and newborn. In: Feigin and Cherry's Textbook of Pediatric Infectious Diseases, 6th ed. Feigin RD, Cherry JD, Demmler-Harrison GJ, Kaplan SL (Eds), Saunders, Philadelphia 2009. p.895.",
"      </li>",
"      <li>",
"       Stamos JK, Rowley AH. Timely diagnosis of congenital infections. Pediatr Clin North Am 1994; 41:1017.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f32_26_33196=[""].join("\n");
