var title_f32_26_33197="Suicide resources A";
var content_f32_26_33197=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F69075%7EPEDS%2F78512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F69075%7EPEDS%2F78512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suicide resources",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       In an emergency, call 1-800-SUICIDE (1-800-784-2433), the national suicide hotline",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Academy of Child and Adolescent Psychiatry",
"       </p>",
"       <p>",
"        www.aacap.org",
"       </p>",
"       <p>",
"        202-966-7300",
"       </p>",
"      </td>",
"      <td>",
"       Provides information about developmental, behavioral, and mental disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Association of Suicidology",
"       </p>",
"       <p>",
"        www.suicidology.org",
"       </p>",
"       <p>",
"        202-237-2280",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information on current research, prevention, ways to help a suicidal person, and surviving suicide. A list of crisis centers is also included.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Foundation for Suicide Prevention",
"       </p>",
"       <p>",
"        www.afsp.org",
"       </p>",
"       <p>",
"        888-333-AFSP (2377)",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides research, education, and current statistics regarding suicide; links to other suicide and mental health sites are offered.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        American Psychiatric Association",
"       </p>",
"       <p>",
"        www.psych.org",
"       </p>",
"       <p>",
"        800-852-8330",
"       </p>",
"      </td>",
"      <td>",
"       Information and referrals to psychiatrists.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Boys Town",
"       </p>",
"       <p>",
"        www.boystown.org",
"       </p>",
"       <p>",
"        800-448-3000 (crisis hotline) or 800-545-5771",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Cares for troubled children - both boys and girls - and for families in crisis. Their hotline staff is trained to handle calls and questions about violence and suicide.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Centers for Disease Control Center for Injury Prevention and Control, Division of Violence Prevention",
"       </p>",
"       <p>",
"        www.cdc.gov/ncipc/",
"       </p>",
"       <p>",
"        770-488-4362",
"       </p>",
"      </td>",
"      <td>",
"       Provides links to suicide statistics, the SafeUSA Web site, and safety information.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        National Alliance for the Mentally Ill (NAMI)",
"       </p>",
"       <p>",
"        www.nami.org",
"       </p>",
"       <p>",
"        800-950-NAMI (6264)",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information about family support and self-help groups, links to information about teen suicide, child suicide, brain biology and suicide, as well as general suicide information links.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Depression and Bipolar Support Alliance",
"       </p>",
"       <p>",
"        www.dbsalliance.org",
"       </p>",
"       <p>",
"        800-826-3632",
"       </p>",
"      </td>",
"      <td>",
"       Provides information about mood disorders including support groups and local chapters.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        National Institute of Mental Health (NIMH)",
"       </p>",
"       <p>",
"        www.nimh.nih.gov",
"       </p>",
"       <p>",
"        800-421-4211",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides information on depression and other mental illnesses.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: www.cdc.gov/ncipc/dvp/youth/suicide.htm and www.cdc.gov/safeusa/suicide.htm#Safety%20Resources.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suicide resources (continued)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       In an emergency, call 1-800-SUICIDE (1-800-784-2433), the national suicide hotline.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        National Mental Health Association (NMHA)",
"       </p>",
"       <p>",
"        www.nmha.org",
"       </p>",
"       <p>",
"        800-228-1114",
"       </p>",
"       <p>",
"        800-969-NMHA (6642)",
"       </p>",
"       <p>",
"        800-433-5959 (TTY)",
"       </p>",
"      </td>",
"      <td>",
"       Provides information on depression and its treatment and referrals to local screening sites.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        The National Mental Illness Screening Project Suicide Division",
"       </p>",
"       <p>",
"        www.nmisp.org",
"       </p>",
"       <p>",
"        800-573-4433",
"       </p>",
"      </td>",
"      <td>",
"       Provides information regarding free, confidential screening near you.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Suicide Awareness-Voices of Education (SA\VE)",
"       </p>",
"       <p>",
"        www.save.org",
"       </p>",
"       <p>",
"        612-946-7998",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Provides suicide education, facts, and statistics on suicide and depression. It links to information on warning signs of suicide and the role a friend or family member can play in helping a suicidal person.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Suicide Information &amp; Education Centre (SIEC)",
"       </p>",
"       <p>",
"        www.siec.ca",
"       </p>",
"       <p>",
"        403-245-3900",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       Library and resource center providing information on suicide and suicidal behavior.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Suicide Prevention Advocacy Network (SPAN)",
"       </p>",
"       <p>",
"        spanusa.org",
"       </p>",
"       <p>",
"        888-649-1366",
"       </p>",
"       <p>",
"        Substance Abuse and Mental Health Administration (SAMHSA) www.samhsa.gov",
"       </p>",
"      </td>",
"      <td colspan=\"1\">",
"       SPAN is a nonprofit organization dedicated to creating an effective national suicide prevention strategy. SPAN links the energy of those bereaved by suicide with the expertise of leaders in science, business, government, and public service to achieve the goal of significantly reducing the national suicide rate by the year 2010.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: www.cdc.gov/ncipc/dvp/youth/suicide.htm and www.cdc.gov/safeusa/suicide.htm#Safety%20Resources.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f32_26_33197=[""].join("\n");
