var title_f32_26_33198="Solute removal in PD";
var content_f32_26_33198=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75224&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75224&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Rates of solute diffusion in peritoneal dialysis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 405px; height: 267px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dialysate to plasma concentration ratios (with 1.0 reflecting complete equilibration) for urea, creatinine, inulin, and protein during an eight hour period in which dialysate is allowed to dwell in the peritoneum. Urea equilibration is so rapid that diffusion begins to level off at 90 to 120 minutes and is essentially complete at 240 minutes. Thus, short dwell times will maximize the rate of urea removal. In comparison, larger molecules show a progressive decline in the rate of diffusion. Inulin diffusion, for example, increases linearly with time since a limiting concentration gradient is not approached. As a result, increasing the total time of dialysis enhances the rate of clearance of these larger molecules.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Popovich, RP, Moncrief, JW, Nolph, KD, et al, Ann Intern Med 1978; 88:449.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
